function generarPDF() {
  const { jsPDF } = window.jspdf;
  doc = new jsPDF({ format: "letter", orientation: "portrait" }); // Asignamos a la variable global

  let pageWidth = doc.internal.pageSize.width;
  let pageHeight = doc.internal.pageSize.height;

  let cols = 4; // Número de columnas
  let rows = 11; // Número de filas por página
  let xStart = 0,
    yStart = 25; // Posición inicial
  let width = pageWidth / cols; // Ancho de cada etiqueta
  let height = pageHeight / rows; // Alto de cada etiqueta

  let filas = [];
  document.querySelectorAll("#tabla-body tr").forEach((fila) => {
    let datos = [];
    fila.querySelectorAll("td:not(:last-child)").forEach((celda) => {
      datos.push(celda.textContent.trim());
    });
    filas.push(datos);
  });

  let colIndex = 0,
    rowIndex = 0,
    etiquetaIndex = 0;

  filas.forEach((fila, index) => {
    let x = xStart + colIndex * width;
    let y = yStart + rowIndex * height;

    doc.rect(x, y, width, height);

    let logoBase64 =
      "data:image/png;base64,";
    doc.addImage(logoBase64, "PNG", x + 10, y + 2, 33, 5); // Insertamos la imagen en Base64

    doc.setFontSize(9);
    doc.setTextColor(0, 0, 0);
    doc.setFont("helvetica", "normal");

    doc.setFillColor(255, 255, 0);
    doc.rect(x + 3, y + 8, 48, 8, "F");

    doc.setFillColor(135, 206, 235);
    doc.rect(x + 3, y + 17, 48, 4, "F");

    doc.setFont("helvetica", "bold");

    doc.text(`${fila[0]}`, x + 5, y + 11);
    doc.text(`TRM: ${fila[1]}`, x + 15, y + 11);
    doc.text(`${fila[2]}`, x + 5, y + 15);
    doc.setTextColor(255, 0, 0);
    doc.text(`| ${fila[5]}`, x + 25, y + 15);
    doc.setTextColor(0, 0, 0);
    doc.text(`REF: ${fila[6]}`, x + 5, y + 20);

    doc.setFontSize(6);
    doc.setTextColor(16, 72, 98);
    doc.text("transmicajas.com", x + 2, y + 24);
    doc.text("cel: 3213160824", x + 36, y + 24);

    colIndex++;
    etiquetaIndex++;

    if (colIndex >= cols) {
      colIndex = 0;
      rowIndex++;
    }

    if (etiquetaIndex >= cols * rows) {
      doc.addPage();
      rowIndex = 0;
      etiquetaIndex = 0;
    }
  });

  doc.save("Rotulos.pdf");

  if (window.innerWidth >= 767) {
    let pdfData = doc.output("blob");
    let pdfURL = URL.createObjectURL(pdfData);
    let pdfFrame = document.getElementById("pdf-preview");
    let pdfContainer = document.getElementById("pdf-container");

    if (pdfFrame && pdfContainer) {
      pdfFrame.src = pdfURL;
      pdfContainer.style.display = "block"; // Asegura que se muestre el contenedor
    } else {
      console.warn(
        "No se encontró el iframe o el contenedor con id 'pdf-preview' / 'pdf-container'"
      );
    }
  }
}
